import React from 'react';
import classes from "./Header.module.css";
import Navigation from './Navigation';

const Header = () => {
    return (
        <header className={classes.header}>
            <img className={classes.img} src="/img/logo.svg" alt="1"/>
            <Navigation />
        </header>
    );
}

export default Header;
